import React from "react";

export const ContactPicker = ({contacts, changeContactPicker, value, name}) => {
  return (
    <select onChange={changeContactPicker} value={value} name={name}>
      <option value=""></option>no Contact Selected
      {contacts.map((contact, index) => {
        return (<option key={index}>{contact.name}</option>);
      })}

    </select>
  );
};
